import React from 'react';
import styled from 'styled-components';

import { Map, GoogleApiWrapper } from 'google-maps-react';

function Confirmation(props) {
    const mapStyles = {
        width: '100%',
        height: '50vh'
    }
    return (
        <Container>
            <ConfirmationTop>
                <img src="/assets/FoodDeliveryApp.png" alt="Food Delivery App Logo"/>
                <h1>confirmation</h1>
            </ConfirmationTop>
            <ConfirmationBottom>
                <Map
                    google={props.google}
                    zoom={15}
                    style={mapStyles}
                    initialCenter={
                      {
                        lat: 40.014,
                        lng: -105.269
                      }
                    }
                ></Map>
            </ConfirmationBottom>
        </Container>
    )
}

const Container = styled.div`
    width: 100vw;
    height: 100%;
`

const ConfirmationTop = styled.div`
    width: 100%;
    margin: 20px 50px;
    height: 50vh;

    img {
        width: 200px;
        height: 200px;
    }
`

const ConfirmationBottom = styled.div`
    width: 100%;
    height: 50vh;
`

export default GoogleApiWrapper({
    apiKey: 'AIzaSyDG2yQUqLUTXWRPyDceJqntNldd_v69-Aw'
  })(Confirmation);
